import styled from "styled-components";

const A = styled.a`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    text-align: center;
    margin: 1rem;
`

function Links(props) {
    return (
        <>
            {props.text === props.tarifas && props.subtarifas.map((t, k) => <A>{t}</A>)}
        </>)

}

export default Links;
